import React from 'react';
import {useNavigate} from 'react-router-dom'


const Home = () => {
  const navigate = useNavigate()
  const logoutHandler = () => {
    localStorage.token = ''
    navigate('/login')
  }
  return (
    <div>
      <button onClick={logoutHandler}>Выйти из чата</button>
    </div>
  );
};



export default Home;
